contracts/challenge2.sol.content:
//SPDX-License-Identifier:MIT
pragma solidity ^0.8.7;

contract EtherConverter {
    address payable public owner;

    constructor() {
        owner = payable(msg.sender);
    }

    function depositEther() public payable {
        // Calculate the value of the deposited ether in wei, ether, and gwei
        uint256 weiValue = msg.value;
        uint256 etherValue = weiValue / 1e18; // 1 ether = 10^18 wei
        uint256 gweiValue = weiValue / 1e9; // 1 gwei = 10^9 wei

        // Log the values
        emit EtherValues(weiValue, etherValue, gweiValue);
    }

    event EtherValues(uint256 weiValue, uint256 etherValue, uint256 gweiValue);
}

